import './playlistDetail.css';

import { PHButton } from '@src/ui/common/element/muButton';

let playlistData = {
  playlistId: 0,
  name: '',
  items: [
    {
      itemId: 0,
      title: '',
      itemType: '',  // Maybe name will be different on backend?
      id: '',
      currentListener: [
        {userName: '', userImgUrl: '', userId: 0},
      ],
    },
  ],
  currentPlayingItemIndex: 0,
}
let currentPlayerObject = null;

const PlayCoPlaylistDetail = (props) => {
  return <section className='playCoPlaylistDetailPage' {...props}>
    <header>
      <h2>PlayCO</h2>
      {/* <h5>{'``INSERT 플레이리스트 이름 HERE``'}</h5> */}
    </header>
    <div className='playCoPlaylistDetail'>
      <aside className='playCoPlaylistDetailList'>
        {/* playlist aside */}
        <header>
          <h5>{'``INSERT 플레이리스트 이름 HERE``'}</h5>
        </header>
        <div>
          <PHButton smaller variant='primary'>+ 재생목록에 추가하기</PHButton>
        </div>
        <ul>

        </ul>
      </aside>
      <aside className='playCoPlaylistDetailPlayer'>
        {/* player aside */}
      </aside>
    </div>
  </section>;
};

export { PlayCoPlaylistDetail };
